import {Swiper, SwiperSlide} from 'swiper/react'
import { SwiperCore } from "swiper";
import './swiper/swiper-bundle.css';
import Logo from "./logo.svg";
import './App.css';

function App() {
  const slides = []
  for(let i =0; i < 5; i +=1){
    slides.push(
      <SwiperSlide key={`slide-${i}` } >
        <img src='logo'/>
      </SwiperSlide>
    )

  }
  return (
    <div className="App">
      <h1 className=''  >Hello React</h1>
      <div>
        <Swiper id='main' >
          {slides}
        </Swiper>
      </div>
    </div>
  );
}

export default App;
